export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},G6XzaQu7lZ:{data:{id:769,attributes:{imdbId:"tt1648190",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTU3MjUwMzQ3MF5BMl5BanBnXkFtZTgwMjcwNjkxMjI@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.6\u002F10"},{Source:"Rotten Tomatoes",Value:"16%"},{Source:"Metacritic",Value:"34\u002F100"}],item_lang:{data:{id:1432,attributes:{title:i,plot:"11-year-old Jake Chambers experiences visions involving a Man in Black who seeks to destroy a Tower and bring ruin to the Universe while a Gunslinger opposes him. However, Jake's mother, stepfather and psychiatrists dismiss these as dreams resulting from the trauma of his father's death the previous year. At his apartment home in New York City, a group of workers from an alleged psychiatric facility offer to rehabilitate Jake; recognizing them from his visions as monsters wearing human skin, he flees from the workers who give chase. Jake tracks down an abandoned house from one of his visions where he discovers a high-tech portal that leads to a post-apocalyptic world called Mid-World..",slug:"the-dark-tower"}}},books:{data:[{id:4913,attributes:{title:"The Dark Tower I",description:j,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uagODAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2016-05-03",publisher:d,subtitle:e}},{id:4914,attributes:{title:"The Dark Tower Boxed Set",description:"For the first time ever as a complete ebook series, all of Stephen King’s eight Dark Tower novels—one of the most acclaimed and popular series of all time—now a major motion film starring Idris Elba and Matthew McConaughey. Set in a world of ominous landscape and macabre menace, The Dark Tower series features one of Stephen King’s most powerful creations—The Gunslinger—a haunting figure who embodies the qualities of the lone hero through the ages, from ancient myth to frontier Western legend. As Roland crosses a desert of damnation in a treacherous world that is a twisted image of our own, he moves ever closer to the Dark Tower of his dreams—and nightmares. This stunning, must-have collection includes: The Dark Tower I: The Gunslinger; The Dark Tower II: The Drawing of the Three; The Dark Tower III: The Waste Lands; The Dark Tower IV: Wizard and Glass; The Dark Tower: The Wind Through the Keyhole; The Dark Tower V: Wolves of the Calla; The Dark Tower VI: Song of Susannah; and The Dark Tower VII: The Dark Tower. The perfect keepsake for Stephen King fans, The Dark Tower 8-Book Boxed Set is the most extraordinary and imaginative cycle of tales in the English language from “the reigning King of American popular literature” (Los Angeles Daily News).",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=StsyDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2017-09-05",publisher:d,subtitle:f}},{id:4915,attributes:{title:"The Dark Tower I (MTI)",description:j,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=xeIoDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2017-06-27",publisher:d,subtitle:e}},{id:4916,attributes:{title:e,description:"Roland, the world's last gunslinger, tracks an enigmatic Man in Black toward a forbidding dark tower, fighting forces both mortal and other-worldly on his quest",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=X7ZJaea0P7cC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2003-01-01",publisher:"Penguin",subtitle:f}},{id:4917,attributes:{title:i,description:"The final volume sees gunslinger Roland on a roller-coaster mix of exhilarating triumph and aching loss in his unrelenting quest to reach the dark tower. Roland's band of pilgrims remains united, though scattered. Susannah-Mia has been carried off to New York to give birth, Terrified of what may happen, Jake, Father Callahan and Oy follow. Roland and Eddie are in Maine, looking for the site which will lead them to Susannah. As he finally closes in on the tower, Roland's every step is shadowed by a terrible and sinister creation. And finally, he realises, he may have to walk the last dark strait alone... You've come this far, Come a little farther, Come all the way, The sound you hear may be the slamming of the door behind you. Welcome to The Dark Tower.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3mwdygAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2012-02-01",publisher:"Hodder & Stoughton",subtitle:f}}]}}},meta:{}}},prerenderedAt:1682568430767}}("Stephen King","movie",null,"Simon and Schuster","The Gunslinger","","series",1,"The Dark Tower","\"Soon to be a major motion picture\"--Cover."))